import React from "react";

const Products = () => {
  return (
    <>
      <h1>The Products page</h1>
      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
        <li>Product 4</li>
      </ul>
    </>
  );
};

export default Products;
